import React from 'react';

class Engine extends React.Component {
  constructor(props) {
    super(props);
    this.state = {target: 0};
  }

  render() {
    return (
      <div>
        <h1>Hello, world!</h1>
      </div>
    );
  }
}

export default Engine;
